import MeetupForm from "../components/meetups/MeetupForm.js";
import Card from "../components/ui/Card.js"
function NewMeetupPage() {
	return (
		<div>
			<div>New Meetup</div>
			<Card>
				<MeetupForm />
			</Card>
		</div>
	);
}
export default NewMeetupPage;
